import React, { Component } from 'react';

export class Repair_article1 extends Component {
    render() {
        return (
            <div>
                <div className="article-wrapper">
                    <div className="container">
                        <div className="row">
                            <div className="col-12">
                                <a class="btn btn-primary" href="/repair" role="button">Return</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
